        console.log("use effect run");
        const apicall = async () => {
            console.log("apicall rn");
            const response = await fetch(`http://localhost:8080/pdata/34`);
            const data = await response.json();
            console.log("data", data);
        };

        apicall();
    }, [id]);

    return (
        <div>
            <h1>API call</h1>
            <p>id: {id}</p>
            <button onClick={() => setId("2")}>Change ID</button>
            <button onClick={() => setId("3")}>Change ID</button>
            <button onClick={() => setId("4")}>Change ID</button>
        </div>
    );
};
//http://localhost:8080/pdata/34
export default Api;
